import React from 'react';

import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';

import LeftNav from '../../../components/LeftNav';
import InfoCard from '../../../components/Infocard';
import TreeItem from '../../../components/TreeItem';

import Pageheader from '../../../components/PageHeader';
import TreeBranchGroup from '../../../components/TreeBranchGroup'; 
import {Dropdown, Button, NavItem} from 'react-materialize';




  const options = [
    'Show some love to Material-UI',
    'Show all notification content',
    'Hide sensitive notification content',
    'Hide all notification content',
  ];



export default class Tree extends React.Component {


    state = {
        anchorEl: null,
        selectedIndex: 1,
      };

      handleClickListItem = event => {
        this.setState({ anchorEl: event.currentTarget });
      };

      handleMenuItemClick = (event, index) => {
        this.setState({ selectedIndex: index, anchorEl: null });
      };

      handleClose = () => {
        this.setState({ anchorEl: null });
      };



    render() {
        const { anchorEl } = this.state;

      return (
        <div className="Wrapper"> 
        <div className="Grid_wrapper">
            <div className="Grid_2Col">

            <div className="Column_feed">
                <TreeItem img="100008343750912" name="Adam Donatelli" location="St. Petersburg" bornYear="1983"/>
                <LeftNav/>
                <InfoCard 
                    location='St. Petersburg'
                    age='35'
                    education='University of Arizona'
                    bornIn="Hobbs,NM"
                    />
            </div>



            <div> 
                <div className="HeaderWrapper"> 
                <Pageheader text="Tree" icon="burst_mode" />

                <div>

                <List component="nav">
                    <ListItem
                        button
                        aria-haspopup="true"
                        aria-controls="lock-menu"
                        // aria-label="When device is locked"
                        onClick={this.handleClickListItem}
                        >
                        <ListItemText
                        primary="Options"
                        // secondary={options[this.state.selectedIndex]}
                        />
                    </ListItem>
                </List>

                    <Menu 
                    id="lock-menu"
                    anchorEl={anchorEl}
                    open={Boolean(anchorEl)}
                    onClose={this.handleClose}
                    >
                        {options.map((option, index) => (
                        <MenuItem
                        key={option}
                        selected={index === this.state.selectedIndex}
                        onClick={event => this.handleMenuItemClick(event, index)}
                        >
                        {option}
                        </MenuItem>
                    ))}
                    </Menu>

                </div>

                </div>

                <div className="TreeBranchWrapper">
                <TreeBranchGroup title="Greg and Victoria Donatelli (Mom & Dad)"/>
                <TreeBranchGroup title="Victor and Leti Polanco (Mom & Dad)"/>

                <TreeBranchGroup title="Marina Lowe (Sister)"/>
                <TreeBranchGroup title="Angelo Donatelli (Brother)"/>

                </div>

            </div>

            </div>
        </div>
        </div>



        );
    }
}
